SELECT card_name FROM cards WHERE card_name like "%%" AND description like "%%" AND card_type like "%%" AND card_type like "%Card Sub Type%" AND card_type like "%%" AND attribute_type like "%%" AND level_stars like "%%" OR rank_stars like "%%" AND atk_points >= 1 AND atk_points <= 30000 AND def_points >= 1 AND def_points <= 30000 AND setini like "%EOJ%" AND card_number like "%%" ORDER BY card_name ASC;